import React from 'react';

function Navbar() {
    return (
        <nav className="navbar sticky-top navbar-dark bg-primary ">
            <span>Loop Fruits</span>
            <span>Right or Wrong</span>
            <ul className="navbar-nav nav flex-column">
                <li className="nav-item"><h1>Loop Fruits</h1></li>
                <li className="nav-item">Right or Wrong</li>
                <li className="nav-item">Score Stuff</li>
            </ul>
        </nav>
    );
};

export default Navbar;
